Chega's youth (acronym: JCH; stylized in capital letters) is a Portuguese partisan youth, with a populist, radical right, nationalist, conservative ideology, with its political spectrum defined as being from the right to the extreme right. JCH is the youth supporter of the CHEGA party. Currently, Youth is coordinated by MP Rita Matias.


== Genesis ==
JCH, as the Youth of the CHEGA Party, is dedicated to the political training of young people, adopting as principles and values the provisions of the statutes of the CHEGA Party. Pursuant to article 2 of its Statutes, the JCH's fundamental tasks are:

The promotion and defense of political democracy in its social, economic and cultural aspects, enshrined in the values of the Rule of Law and the emerging principles of human dignity;
The protection of human dignity and the fundamental value of freedom in its various aspects, against all forms of totalitarianism;
The promotion of the common good and intergenerational and territorial solidarity, with a view to promoting the integral development of the Nation;
The defense of a secular State independent of any church or religion, without prejudice to the safeguard and inviolability of the fundamental right to religious and cultural practice, within the framework of the basic values of the Democratic Rule of Law;
The defense of History, Culture and the Portuguese language, with a view to promoting the cultural and scientific development of the Nation as constitutionally guaranteed values;
The fight against corruption of interests and all forms of weakening of the Republic that we are witnessing today, namely corruption in the State, the weakening of security forces and bonds of solidarity within the community;


== National Directorate ==
The JCH National Directorate is the body responsible for implementing and executing the political strategy defined by the Party's National Directorate, as well as for political oversight of the activities of district and regional youth bodies. The members of the JCH National Board are appointed by the Party's National Board, following a proposal from the Youth Coordinator, for 3-year terms. The National Board is made up of 1 president, 1 secretary-general, 3 vice-presidents and 6 direction vowel.


== Present ==
Chega's youth is currently involved in the Party's activities, participating in its events and contributing to the promotion of proposals to be presented by the party in elections and in the Assembly of the Republic. The number of young people enrolled in Youth increased from three thousand in 2023 to six thousand in 2024, related to the growth of the campaign on social media. In the first survey of 2024, CHEGA was indicated as the party with the most votes among young people aged 18 to 34. After the 2024 legislative elections, CHEGA now has three MPs: Rita Matias, Madalena Cordeiro and Daniel Teixeira on the parliamentary group. Madalena Cordeiro is the youngest deputy in the current legislature, the XVI. In the previous legislature, the XV, the title of youngest deputy belonged to Rita Matias.


